const Welcome = (props) => {
//{/*value={firstName} onChange={(e)=>handleChange(e)}*/}
    return (
        <div className="welcome">
           <h1>Welcome</h1>
           <p>This is a demo project, data entered here are being stored on the database which can be seen by the admin</p>
<p>Kindly fill in your details correctly
    <br />
    Thank You!
</p>
<div className="btn-container">
<button onClick={()=> props.handleClick()}className="proceed-btn">Continue</button>
</div>
<div>
<input className="name" type="text"   id="firstName" placeholder="First name" required />
<input className="name" type="text" id="lastName"  placeholder="Last name" required />
        </div>	
        <div id="mail">
    <input className="email" type="email" id="email"  placeholder="Email" required />
    
    <input className="email" type="phone" id="phone"  placeholder="Phone number" required />
        </div>
        </div>
      );
}
 

export default Welcome;
